import React, {useState} from 'react';
import 'antd/dist/antd.css';
import '../index.css';
import {
    Form,
    Select,
    Button,
    Upload,
 Input,
} from 'antd';

import {  InboxOutlined } from '@ant-design/icons';
import {Option} from "antd/es/mentions";
import {getTime, uploadfile} from "./wortwhile";
import axios from "axios";

const baseUrl = "http://localhost:5000";
const formItemLayout = {
    labelCol: {
        span: 6,
    },
    wrapperCol: {
        span: 14,
    },
};

const normFile = (e) => {
    console.log('Upload event:', e);

    if (Array.isArray(e)) {
        return e;
    }

    return e && e.fileList;
};

const Demo = () => {
    const onFinish = (values) => {
        console.log("onFinish")
        console.log('Received values of form: ', values);
        console.log('normFile',normFile);
        console.log(values)
        submitForm(values)
    };
    const submitForm = (values) => {
        console.log(values)
        const formData = new FormData();
        // formData.append("name", name);
        formData.append("type", values['type']);
        formData.append("project_name", values["project_name"]);
        formData.append("file", values["project_name"]);

        // const formData = new FormData();
        // formData.append("name", "name");
        // formData.append("file", "selectedFile");
        // console.log("normFile")
        console.log(normFile)
        // console.log("onFinish")
        // console.log(onFinish)
        // let x = getTime()
        // console.log(x)
        console.log("thaovt")
        console.log(values)
        console.log("formData")
        console.log(formData.get("project_name"))

        axios
            .post(`${baseUrl}${'/wortwhile/uploadfile'}`, formData)
            .then((res) => {
                alert("File Upload success");
            })
            .catch((err) => alert("File Upload Error"));
        // let t = uploadfile(values)

        // console.log(t)
    };

    return (
        <Form
            name="validate_other"
            {...formItemLayout}
            onFinish={onFinish}
            enctype="multipart/form-data"
        >
            <Form.Item
                {...formItemLayout}
                name="project_name"
                label="Your project name"
                rules={[
                    {
                        required: true,
                        message: 'Please input your project name',
                    },
                ]}
            >
                <Input placeholder="Please input your project name" />
            </Form.Item>
            <Form.Item
                name="type"
                label="type"
                hasFeedback
                rules={[
                    {
                        required: true,
                        message: 'Please input your type',
                    },
                ]}
            >
                <Select placeholder="Please input your type">
                    <Option value="file">File</Option>
                    <Option value="repo">Repo</Option>
                </Select>
            </Form.Item>
            <Form.Item
                {...formItemLayout}
                name="linkRepo"
                label="Link Repo"
            >
                <Input placeholder="Please input link repo" />
            </Form.Item>
            <Form.Item label="file">
                <Form.Item name="file" valuePropName="fileList" getValueFromEvent={normFile} noStyle fileList={normFile}>
                    <Upload.Dragger name="files" beforeUpload={() => false}>
                        <p className="ant-upload-drag-icon">
                            <InboxOutlined />
                        </p>
                        <p className="ant-upload-text">Click or drag file to this area to upload</p>
                        <p className="ant-upload-hint">Support for a single or bulk upload.</p>
                    </Upload.Dragger>
                </Form.Item>
            </Form.Item>

            <Form.Item
                wrapperCol={{
                    span: 12,
                    offset: 6,
                }}
            >
                <Button type="primary" htmlType="submit" >
                    Submit
                </Button>
            </Form.Item>
        </Form>
    );
};

export default Demo
